import React from "react";
import { HashLink as Link } from 'react-router-hash-link';
const Header = () => {
  return (
   <div className="topNav" id="header">
    <a href="/#">Movie Maker</a>
    <Link smooth to="/#" className="addButton">Add a movie</Link>
   </div>
  );
}

export default Header;
